// src/components/pages/Home.jsx
import React from 'react';
import { Link } from 'react-router-dom';
import './Home.css';

export default function Home() {
  return (
    <div className="home-hero">
      <div className="hero-overlay">
        <div className="container text-center text-white py-5">
          <h1 className="display-4 fw-bold mb-3">Hire Top Freelancers</h1>
          <p className="lead mb-4">Post your project and get work done with confidence.</p>
          <Link to="/register" className="btn btn-lg btn-success shadow-sm px-4">
            Get Started
          </Link>
        </div>
      </div>
    </div>
  );
}
